import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div style={{ textAlign: 'center', padding: '50px' }}>
      <h1>Bienvenue sur notre application</h1>
      <p>Veuillez vous connecter ou vous inscrire pour accéder à votre tableau de bord</p>
      <div style={{ display: 'flex', gap: '20px', justifyContent: 'center', marginTop: '20px' }}>
        <Link to="/login" style={{ 
          textDecoration: 'none',
          padding: '10px 20px',
          backgroundColor: '#007bff',
          color: 'white',
          borderRadius: '5px'
        }}>
          Se connecter
        </Link>
        <Link to="/register" style={{ 
          textDecoration: 'none',
          padding: '10px 20px',
          backgroundColor: '#28a745',
          color: 'white',
          borderRadius: '5px'
        }}>
          S'inscrire
        </Link>
        <div className='Simon'>

        </div>
      </div>
    </div>
  );
};

export default Home;
